/**
 * PDF Font Registration Utilities
 *
 * Provides custom font registration for jsPDF documents.
 * Uses Bison Bold for headings and Graphik for body text.
 */

import { jsPDF } from 'jspdf'

export const FONT_BISON = 'Bison'
export const FONT_GRAPHIK = 'Graphik'

// Base64-encoded font data (converted from TTF files)
const BisonBoldBase64 =
  ''

const GraphikRegularBase64 =
  ''

const GraphikSemiboldBase64 =
  ''

/**
 * Registers custom fonts with a jsPDF document.
 * - Bison Bold: For main headings (NYCKELKVITTENS, NYCKLAR, etc.)
 * - Graphik Regular: For body text
 * - Graphik Semibold: For sub-headers and table headers (use with 'bold' style)
 *
 * Must be called after creating the jsPDF instance and before using the fonts.
 */
export function registerCustomFonts(doc: jsPDF): void {
  // Add fonts to Virtual File System
  doc.addFileToVFS('Bison-Bold.ttf', BisonBoldBase64)
  doc.addFileToVFS('Graphik-Regular-App.ttf', GraphikRegularBase64)
  doc.addFileToVFS('Graphik-Semibold-App.ttf', GraphikSemiboldBase64)

  // Register fonts for use
  doc.addFont('Bison-Bold.ttf', FONT_BISON, 'bold')
  doc.addFont('Graphik-Regular-App.ttf', FONT_GRAPHIK, 'normal')
  doc.addFont('Graphik-Semibold-App.ttf', FONT_GRAPHIK, 'bold') // Semibold as bold style
}
